	<script type="text/javascript">
		var OPTION_SEPARATOR ="---other---";
		var canvas;
		var heatmap;
		var pos = [];		
		var maps = [];
		var actual_map;
		var s = 2.048;
		var w = 500;
		var ctx;
		var animation_speed = 10;
		var timers = [];


		function parseData(){			
			for (var i = data.length - 1; i >= 0; i--) {				
				if(maps[""+data[i][3]] == undefined) maps[data[i][3]] = [];
				maps[""+data[i][3]].push(data[i]);				
			};					
		}

		function createButton(mapname){

				var t = mapname;				
				var btn = document.createElement("button");
				var text = document.createTextNode(t);
				btn.appendChild(text);
				btn.addEventListener("click",function(){ setMap(t)},false);
				var btnsNav = document.getElementById('btns');
				btnsNav.appendChild(btn);
		}

		function createOption(mapname){

				var t = mapname;				
				var option = document.createElement("option");
				var text = document.createTextNode(t);
				option.value = mapname;
				option.appendChild(text);				
				var optionsNav = document.getElementById('select');
				optionsNav.appendChild(option);
		}

		function mapSelect(){
			var x = document.getElementById('select').value;
			if(x==OPTION_SEPARATOR) return;
			setMap(x);
		}


		function generateNav(){			

			console.log(maps);
			var keys = [];
			for (var key in maps) {
				 if (maps.hasOwnProperty(key))
    				keys.push(key);
			};
			keys.sort();
			
			var others = [];
			for (var i = 0; i < keys.length; i++) {	
				var isNotOthers = (((keys[i].indexOf("120") > -1) || (keys[i].indexOf("130") > -1) || (keys[i].indexOf("110") > -1)	|| (keys[i].indexOf("140") > -1)) && (keys[i].indexOf("-0") > -1));
				others.push(!isNotOthers);
				if(isNotOthers){
					createOption(keys[i]);										
				} 
			};
			console.log(others);
			createOption(OPTION_SEPARATOR);
			for (var i = 0; i < keys.length; i++) {					
				if(others[i])
					createOption(keys[i]);
				
			};		



		}

		

		window.onload = function(){					



			canvas = document.getElementsByTagName('canvas')[0];			
			heatmap = createWebGLHeatmap({canvas: canvas, intensityToAlpha:true});
			parseData();
			generateNav();			
			setMap('level_id_1201-0');
			slider_change();

			var raf = window.requestAnimationFrame || window.mozRequestAnimationFrame ||
			window.webkitRequestAnimationFrame || window.msRequestAnimationFrame;

			var update = function(){

                    // heatmap.adjustSize(); // can be commented out for statically sized heatmaps, resize clears the map
                    heatmap.update(); // adds the buffered points
                    heatmap.display(); // adds the buffered points
                    //heatmap.multiply(0.9995);
                    //heatmap.blur();
                    //heatmap.clamp(0.0, 1.0); // depending on usecase you might want to clamp it
                    raf(update);


                }
                raf(update);

            }


            function slider_change(){
            	animation_speed = document.getElementById('slider').value;
            	document.getElementById('playback_info').innerHTML = "Playback speed(time inbetween deaths):"+animation_speed+"ms";
            	setMap(actual_map);
            	console.log(animation_speed);
            }

            function setMap(map){
            	actual_map = map;
            	console.log("actualmap:"+map);
            	for (var i = 0; i < timers.length; i++) {
            		clearTimeout(timers[i]);
            	};
            	timers = [];

            	

            	canvas = document.getElementsByTagName('canvas')[0];
            	heatmap = createWebGLHeatmap({canvas: canvas, intensityToAlpha:true});

            	document.body.appendChild(heatmap.canvas);
            	pos = maps[map];

            	pos.sort(function(a, b){return a[5] - b[5]});            


            	bg = 'barrow';
            	if(map.indexOf("120") > -1) bg = 'barrow';
            	if(map.indexOf("140") > -1) bg = 'itaipu';
            	if(map.indexOf("110") > -1) bg = 'havre';
            	if(map.indexOf("130") > -1) bg = 'pripyat';
            	canvas.style.backgroundImage = "url('"+bg+".png')";


            	for (var i = pos.length - 1; i >= 0; i--) {                    
            		timers.push(setTimeout(function(i,map){anim(i,map);},animation_speed*i,i,map));   
            	};
            }


            function anim(i,map){                	
            	heatmap.addPoint((pos[i][0]+w)*s,(pos[i][2]+w)*s, 10, 0.8);
            	var t = document.getElementById('time');
            	t.innerHTML = 'Map: '+map +' <br><br>Time of death(#'+i+'): minute '+(Math.round(pos[i][5]/60));

            }



        </script>
        <style type="text/css">
        	body,html,canvas{
        		width: 100%;
        		height: 100%;
        		margin: 0;
        		padding: 0;
        		font-family: sans-serif;
        		color: black;

        	}
        	div.controls{
        		font-weight: bold;
        		position: absolute;
        		top: 10px;
        		left: 10px;
        	}

        	canvas{
        		width: 2048px;
        		height: 2048px;
        		background: url('./barrow.png');
        		background-size: 100% 100%;
        		display: block;
        		background-repeat: no-repeat;


        	}
        	#slider{
        		width: 500px;
        	}

        	#time{
        		position: absolute;
        		top: 100px;
        		left: 600px;
        		color: #FFFFFF;
        		font-size: 42px;
        		/*text-align: center;*/
        	}
        </style>
    </head>
    <body>
    	<nav id="btns"></nav>
    	<p>
    	Select map:<select onchange="mapSelect()" id="select"></select>
		</p>

    	<input id="slider" type="range" min="10" max="2000" step="100" value="10" onchange="slider_change()" />
    	<br><span id="playback_info">playback speed: </span>
    	<h1 id="time">Time of death: 0</h1>
    	<canvas width="2048" height="2048"></canvas>        
    </body>
    </html>
